import React from 'react';
import Produit from './Produit';

const Bannieretopproduits = (props) => {
    const produit_json = [
        {
            nom:"Caméra réveil",
            sousNom:"Voir sans être vu",
            prix:165,
            image:"https://www.tomsguide.fr/content/uploads/sites/2/cache/2021/11/nest-indoor/3552683667.png" ,
        },
        {
            nom:"Caméra réveil",
            sousNom:"Voir sans être vu",
            prix:165,
            image:"https://www.tomsguide.fr/content/uploads/sites/2/cache/2021/11/nest-indoor/3552683667.png" ,
        },
        {
            nom:"Caméra réveil",
            sousNom:"Voir sans être vu",
            prix:165,
            image:"https://www.tomsguide.fr/content/uploads/sites/2/cache/2021/11/nest-indoor/3552683667.png" ,
        },
    ]
    const produits = produit_json.map(p => <Produit user={props.user} showHideModal={props.showHideModal} modalContent={props.modalContent} setModalcontent={props.setModalcontent} nom={p.nom} sousNom={p.sousNom} prixSansReduc={100} prix={p.prix} image={p.image}/>)
    return (

		<div className="w-100 d-flex flex-column align-items-center">
					<h4 className="bannSoustitre mt-3">
						{props.titre}
					</h4>		
					<div className="d-flex flex-md-row flex-column w-100 justify-content-center align-items-center ">
                        {produits}
					</div>
		</div>
    );
}

export default Bannieretopproduits;
